def button1_clicked():
    global file_window
    file_window=tk.Toplevel(root)
    file_window.geometry("560x250")
    file_window.title("select an audio file: ")
    
    filepath_label=tk.Label(file_window,text="File Path")
    message_label=tk.Label(file_window,text="Message")
    email_label=tk.Label(file_window,text="Sender email")
    smtp_label=tk.Label(file_window,text="SMTP password")
    receiver_label=tk.Label(file_window,text="Receiver email")
    
    filepath_entry=tk.Entry(file_window,width=60)
    message_entry=tk.Entry(file_window,width=60)
    email_entry=tk.Entry(file_window,width=60)
    smtp_entry=tk.Entry(file_window,width=60,show="*")
    receiver_entry=tk.Entry(file_window,width=60)
    
    
    
    
    def browse_file():
        file_path=filedialog.askopenfilename(
            filetypes=[("wave files","*.wav")]
            
        )
        filepath_entry.delete(0,tk.END)
        filepath_entry.insert(0,file_path)
    global button_image
    
    browse_button=tk.Button(file_window,text="Browse files",command=browse_file)
    
    def hide_text_in_audio():
        
        loading_window=tk.Toplevel(root)
        loading_window.title("Loading")
        loading_window.geometry("200x100")
        loading_label=tk.Label( loading_window ,text="Encoding.....",font=("Arial",14))
        loading_label.pack(pady=20)
        
        def encode_audio():
            audio_path=filepath_entry.get()
            sender_email=email_entry.get()
            receiver_email=receiver_entry.get()
            smtp_password=smtp_entry.get()
            if audio_path=='':
                messagebox.showerror("Error","please select a file to encode")
                loading_window.destroy()
                return 
            if not os.path.exists(audio_path):
                messagebox.showerror("Error","Invalid file path")
                loading_window.destroy()
                return
            else:
                file_name=os.path.basename(audio_path)
                folder_name="Output"
                
                if not os.path.exists(folder_name):
                    os.makedirs(folder_name)
                output_path=os.path.join("Output",file_name)
                key=Fernet.generate_key()
                message=message_entry.get()
                f=Fernet(key)
                secret_message=f.encrypt(message.encode())
                secret_message=str(secret_message)
                audio=wave.open(audio_path,mode='rb')
                
                params=audio.getparams()
                frames=audio.readframes(audio.getnframes())
                frames=bytearray(frames)
                message_length=len(secret_message)
                for i in range(4):
                    frames[i]=(frames[i] & 0xFE) |((message_length >> ((3-i)*8))&0xFF)
                
                for i in range(len(secret_message)):
                    byte=ord(secret_message[i])
                    for j in range(8):
                        index=4+(i*8)+j
                        frames[index]=(frames[index] & 0xFE)| ((byte >> (7-j))& 0x01)
                output_audio=wave.open(output_path,mode='wb')
                output_audio.setparams(params)
                output_audio.writeframes(frames)
                
                audio.close()
                output_audio.close()
                sender_email=sender_email
                receiver_email=receiver_email
                subject='the key and encoded audio'
                message='the key and encoded audio is:\n'+str(key)
                
                audio_path=output_path
                msg=MIMEMultipart()
                msg['From']=sender_email
                msg['To']=receiver_email
                msg['Subject']=subject
                
                msg.attach(MIMEText(message,'plain'))
                
                smtp_server='smtp.gmail.com'
                smtp_port=587
                smtp_username=sender_email
                smtp_password=smtp_password
                
                server=smtplib.SMTP(smtp_server,smtp_port)
                server.starttls()
                try:
                    server.login(smtp_username, smtp_password)
                except smtplib.SMTPAuthenticationError:
                    messagebox.showerror("Error","Wrong SMTP Password")
                    loading_window.destroy()
                    return
                try:
                    server.send_message(msg)
                except smtplib.SMTPRecipientsRefused:
                    messagebox.showerror("Error","INvalid email address")
                    loading_window.destroy()
                    return   
                server.quit()
                
                loading_window.destroy()
                messagebox.showinfo("Info","Audio encoded succesfully")
                file_window.destroy()
        thread=threading.Thread(target=encode_audio)
        thread.start()
    encrypt_button=tk.Button(file_window,text="Hide Text",font=("Arial",14,"bold"),bg="red",fg="white",command=hide_text_in_audio) 
    filepath_label.grid(row=0,column=0,sticky=tk.E)
    filepath_entry.grid(row=0,column=1)
    browse_button.grid(row=0,column=2)
    message_label.grid(row=1,column=0)
    message_entry.grid(row=1,column=1)
    email_label.grid(row=2,column=0)
    email_entry.grid(row=2,column=1)
    smtp_label.grid(row=3,column=0)
    smtp_entry.grid(row=3,column=1)
    receiver_label.grid(row=4,column=0)
    receiver_entry.grid(row=4,column=1)
    encrypt_button.grid(row=5,column=1)
    
    file_window.grid_rowconfigure(0,weight=0)
    file_window.grid_columnconfigure(1,weight=0)
    filepath_label.grid(padx=10,sticky="w")
    filepath_entry.grid(pady=10,sticky="w")
    browse_button.grid(padx=10,pady=2,sticky="w")
    message_label.grid(padx=10,sticky="w")
    message_entry.grid(pady=3,sticky="w")
    email_label.grid(padx=10,sticky="w")
    email_entry.grid(pady=3,sticky="w")
    smtp_label.grid(padx=10,sticky="w")
    smtp_entry.grid(pady=3,sticky="w")
    receiver_label.grid(padx=10,sticky="w")
    receiver_entry.grid(pady=3,sticky="w")
    encrypt_button.grid(padx=100,sticky="w")
    
    
    
    file_window.grab_set()
def button2_clicked():
    global file_window
    file_window=tk.Toplevel(root)
    file_window.geometry("550x200")
    file_window.title("select Audio")
    
    filepath_label=tk.Label(file_window,text="File Path")
    password_label=tk.Label(file_window,text="password")
    
    filepath_entry=tk.Entry(file_window,width=60)
    password_entry=tk.Entry(file_window,width=60,show="*")
    
    def browse_file():
        file_path=filedialog.askopenfilename(
            filetypes=[("wave files","*.wav")]
            
        )
        filepath_entry.delete(0,tk.END)
        filepath_entry.insert(0,file_path)
    global button_image
    browse_button=tk.Button(file_window,text="Browse Files",command=browse_file)
    
    def extract_text_from_audio():
        loading_window=tk.Toplevel(root)
        loading_window.title("Loading")
        loading_window.geometry("200x100")
        loading_label=tk.Label( loading_window ,text="Decoding.....",font=("Arial",14))
        loading_label.pack(pady=20)
        
        def decode_audio():
            file_path=filepath_entry.get()
            password=password_entry.get()
            if file_path=='':
                messagebox.showerror("Eror","Please select an audio file to decode")
                loading_window.destroy()
                return 
            if not os.path.exists(file_path):
                messagebox.showerror("Error","Invalid file path")
                loading_window.destroy()
                return

            if password=='':
                messagebox.showerror("Error","please enter a password")
                loading_window.destroy()
                return 
            else:
                key = bytes(password.encode())
                key = key[2:-1]
                    # Open the input audio file
                audio = wave.open(file_path, mode='rb')

                    # Read all frames from the audio file
                frames = audio.readframes(audio.getnframes())

                    # Convert the frames to bytearray for easier manipulation
                frames = bytearray(frames)

                    # Decode the length of the message from the first 32 bits (4 bytes)
                message_length = 0
                for i in range(4):
                        message_length = (message_length << 8) | (frames[i] & 0xFF)

                    # Decode the message from the audio frames using LSB technique
                message = ""
                for i in range(message_length):
                    byte = 0
                    for j in range(8):
                        index = 4 + (i * 8) + j
                        byte = (byte << 1) | (frames[index] & 0x01)
                    message += chr(byte)

                    # Close the audio file
                audio.close()
                
                message=bytes(message.encode())
                message=message[2:-1]
                try:
                    try:
                        f=Fernet(key)
                    except ValueError:
                        messagebox.showerror("Error","Invalid key,Deccoding failed")
                        loading_window.destroy()
                        return 
                    original_message=f.decrypt(message).decode()
                    print(original_message)
                    
                    loading_window.destroy()
                    
                    messagebox.showinfo("Info","The hidden text is\n"+original_message)
                    file_window.destroy()
                except InvalidToken:
                    messagebox.showerror("Error","Invalid key.decoding failed")
                    return 
        thread=threading.Thread(target=decode_audio)
        thread.start()
    decrypt_button=tk.Button(file_window,text="decode audio",font=("Arial",14,"bold"),bg="red",fg="white",command=extract_text_from_audio)
    
    filepath_label.grid(row=0,column=0,sticky=tk.E)
    filepath_entry.grid(row=0,column=1)
    browse_button.grid(row=0,column=2)
    password_label.grid(row=1,column=0)
    password_entry.grid(row=1,column=1)
    decrypt_button.grid(row=2,column=1)
    
    
    file_window.grid_rowconfigure(0,weight=0)
    file_window.grid_columnconfigure(1,weight=0)
    filepath_label.grid(padx=10,sticky="e")
    filepath_entry.grid(pady=10,sticky="w")
    browse_button.grid(padx=10,pady=2,sticky="w")
    password_label.grid(padx=10,sticky="e")
    password_entry.grid(pady=10,sticky="w")
    decrypt_button.grid(padx=10,pady=2,sticky="w")
    
    file_window.grab_set()
    
